import { jsPDF } from 'jspdf';
export const font =
  '';
// Annotate 'this' type with jsPDF instance
const callAddFont = function (this: jsPDF) {
  this.addFileToVFS('DMSans_18pt-Regular-normal.ttf', font);
  this.addFont(
    'DMSans_18pt-Regular-normal.ttf',
    'DMSans_18pt-Regular',
    'normal',
  );
};

// Use 'callAddFont' to add fonts to jsPDF events
jsPDF.API.events.push(['addFonts', callAddFont]);
